var doc = new jsPDF();

//Data string url needed for adding logo to pdf: website used for conversion: https://ezgif.com/image-to-datauri
var RRL = "data:image/png;base64,";
document.getElementById('btn').addEventListener('click', pdf);

function pdf() {
    console.log("making pdf");
    //* Basics
    var date = document.getElementById('date').value;
    var RDVM = document.getElementById('rdvm').value;
    console.log("rdvm: " + RDVM);
    if(RDVM == "Other"){
        RDVM = document.getElementById('otherRDVM').value;
        console.log("other rdvm: " + RDVM);
    }
    var patName = document.getElementById('patientName').value;
    var ownName = document.getElementById('ownerName').value;
    var patHistory = document.getElementById('history').value;

    //* Patient Information
    var gender = document.getElementById('gender').value;
    var age = document.getElementById('age').value;
    var breed = document.getElementById('breed').value;
    console.log("breed: " + breed);
    if(breed == "Other"){
        breed = document.getElementById('otherBreed').value;
        console.log("other breed: " + breed);
    }
    var species = document.getElementById('species').value;
    console.log("species: " + species);
    if(species == "Other"){
        species = document.getElementById('otherSpecies').value;
        console.log("other species: " + species);
    }

    //* EXAM
    var study = document.getElementById('study').value;
    var sedation = document.getElementById('sedation').value;
    var findings = document.getElementById('findings').value;
    var interpretation = document.getElementById('interpretation').value;
    var recommendation = document.getElementById('recommendation').value;
    console.log(age);

    var filename = document.getElementById('filename').value;
    console.log("filename: " + filename);
    if(filename.trim() == ""){
        filename = document.getElementById('normFilename').value;
        console.log("normfilename: " + filename);
    }
    /* Paper is 8x11.5inches but use millimeters 8inches = 203.2mm and  11.5inches = 292.1mm */

    /* Logo Addes logo to top of PDF */
    doc.addImage(RRL, 'png', 46.15, 1.25, 110, 20);

    /* Basic Information section */
    doc.setFontStyle('bold');
    doc.text('Basics', 12.7, 33)
    doc.line(12.7, 34, 100, 34);
    doc.setFontSize(10);
    doc.text('Date: ' + date, 19.05, 39);
    doc.text('RDVM: ' + RDVM, 19.05, 45);
    doc.text('Patient name: ' + patName, 19.05, 51);
    doc.text('Owner: ' + ownName, 19.05, 57);
    doc.text('History: ' + patHistory, 19.05, 63);
    doc.setFontSize(16);
    doc.text('Patient Information', 12.7, 70)
    doc.line(12.7, 71, 100, 71);
    doc.setFontSize(10);
    doc.text('Gender: ' + gender, 19.05, 76);
    doc.text('Age: ' + age, 19.05, 82);
    doc.text('Breed: ' + breed, 19.05, 88);
    doc.text('Species: ' + species, 19.05, 94);
    doc.setFontSize(16);
    doc.text('EXAM', 12.7, 104)
    doc.line(12.7, 105, 100, 105);
    doc.setFontSize(10);
    doc.text('Study: ' + study, 19.05, 110);
    doc.text('Sedation: ' + sedation, 19.05, 116);
    doc.text('Findings: ' + findings, 19.05, 122);
    doc.text('Interpretation: ' + interpretation, 19.05, 128);
    doc.text('Recommendation: ' + recommendation, 19.05, 134);

    doc.save(filename + '.pdf');
}
